Info Please refer to the Community Mods topic for the list of mods created by the community. That would be a good starting point to learn how to create a mod. To create a mod, you need to create a new Lua file in the mods folder. The file should contain a table with the following fields: mod_id(string): A unique identifier for the mod. name(string): The displayed name of the mod. version(string): The version of the mod. author(string): The authors of the mod. description(arrays of string): The description of the mod. enabled(boolean): Whether the mod is enabled or not. TRIGGER_FUNCTIONS(function): The function that will be called when certain events are triggered. Info The available TRIGGER_FUNCTIONS are listed in the API Reference topic. Here is an example of a mod file: local my_mod = { mod_id = "my_mod", name = "My Mod", version = "1.0", author = "Awesome Me", description = { "This is a mod that does something.", "It is very cool." }, enabled = true, on_enable = function() sendDebugMessage("My Mod is enabled!") end,
}
table.insert(mods, my_mod) Rename the file to my_mod.lua and place it in the mods folder. The mod will be loaded when the game is started.

